import React from "react";
import {
  fetchedTasks,
  fetchedCategories,
  deletedTask,
  fetchedColors,
} from "./tasks";

console.log("Context fetchedCategories", fetchedCategories);

export const TasksContext = React.createContext({
  tasks: fetchedTasks,
  categories: fetchedCategories,
  colors: fetchedColors,
  deletedTask: deletedTask,
  justDeleted: false,
  user: "guest",
  currentTask: null,
  mainTaskMovement: "in",
  hideLeftSide: false,
  hideRightSide: false,
});
